import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  width: 874px;
  height: 100%;
  margin: 32px auto 0;
  background-color: #fff;
`;

export default function Dashboard() {
  return (
    <div>
      <Wrapper>test</Wrapper>
    </div>
  );
}
